by Sida.

Challenger Series is a collection of ADC scripts completely designed to integrate with Sida's Auto Carry: Reborn.
The script is currently in open-beta, champions will be added as they become ready for testing.

Currently supported champions:

- Ashe
- Corki
- Graves
- Lucian
- Tristana
- Twitch
- Vayne

Please treat this script as beta and report any issues in the Challenger Series thread: http://forum.botoflegends.com/topic/64012-

Changelog:

    r0.19:
        - All
            - Update to match the changed HPrediction API.

    r0.18:
        - All
            - Temporarily removed shields from killsteal calculations as it's broken in BoL causing
              killsteals to sometimes trigger on full hp units.

    r0.17:
        - Twitch
            - Initial release

        - Corki
            - Q should no longer try to hit at the edge of the spell

        - Vayne
            - Added killsteal including AA, W damage and optional condemn wall collision damage
            - Condemn positions can now be drawn
            - Added time remaining to E Combo and W > AA combo timers.
            - Fixed error caused when attacking nexus/inhibs
            - Fixed error caused by some condemn configurations
            - Slight adjustment to prediction for some condemn calculations

        - Tristana
            - Fixed a bug where killsteal would not check additional enemies after checking a non-valid enemy

    r0.16:
        Vayne:
            - Lowered condemn accuracy slider aggression
            - Condemn now has 5 calculation methods available to choose from, find which suits you best
                - Challenger Series Method: Original method, highest accuracy/highest fps drops
                - Original SAC Method: Condemn method from SAC, average accuracy/lowest fps drops
                - Alternative Method 1: Variation of Challenger Series Method, high accuracy/highest fps drops
                - Alternative Method 2: Lower accuracy and lower FPS drop version of Challenger Series Method
                - Alternative Method 3: Lower accuracy and lower FPS drop version of Alternative Method 1
        Ashe:
            -Updated baseult packets for 5.12

    r0.15:
        Vayne:
            - You can now choose a targeting mode for E Combo; 'SAC target when attackable' or 'Selected target when attackable'
            - Added option to choose to only disable attacks in stealth when an enemy is within x range

    r0.14:
        Tristana:
            - Added option to ignore E damage for R killsteal (using R then waiting for E explosion to kill them)
            - Added option to disable killsteal when E explosion will kill them
        Vayne:
            - New Targeting menu allows you to force focus an enemy with 2 rings either when in range or always.

    r0.13:
        Tristana:
            - Initial release
        Vayne:
            - Added option to auto-ult when x enemies are within range

    r0.12:
        Vayne:
            - Anti-Gapcloser can now condemn Rengar's passive leap and ult leap

    r0.11:
        Vayne:
            - Initial release

    r0.10:
        Graves:
            - Fixed bug that caused chat spam
            - Fixed minor introduced with min W range
    r0.09:
        Graves:
            - All modes now have the option to set max Q range
            - All modes now have the option to only Q after AA
            - All modes now have the option to set min W range
            - Auto ult (non-killsteal version) is now disabled by default
            - Added option to disable skills under tower in lane clear
            - Drawing R killable text can now be disabled
            - Drawing R killable marker can now be disabled
        Corki:
            - Drawing E-Lock marker can now be disabled
        Ashe:
            - Drawing R killable text can now be disabled

    r0.08:
        Graves:
            - Initial release
        Lucian:
            - Now uses jungle monsters for Q
        Ashe:
            - Added option to disable skills under tower in lane clear
            - Multiple small fixes which I forgot :/

    r0.07
        Ashe:
            - Initial release

    r0.06:
        Corki:
            - Will no longer cast spells on turrets when selected with "Focus Selected Target" enabled in SAC
        Lucian:
            - Will no longer cast spells on turrets when selected with "Focus Selected Target" enabled in SAC
            - Minimum mana for Q in lane clear (against champions) now works correctly

    r0.05:
        Corki:
            - Initial release

    r0.04:
        Lucian:
            - Will no longer cast Q to lane clear when set to 0
            - Added option to 'Other' menu to disable skill harass until x level
            - Added option to 'Lane Clear (Other)' menu to disable lane clear skills until x level

    r0.03:
        Lucian:
            - All modes now have the option to only cast W in AA range

    r0.02:
        Lucian:
            - Mana check for lane clear W is actually implemented now
            - Mana check for mixed mode W now correctly uses mixed mode setting instead of auto carry setting

    r0.01:
        Lucian:
            - Initial release

